import React, { useState } from "react";

/// Scrol
import PerfectScrollbar from "react-perfect-scrollbar";

import { Calendar, momentLocalizer } from 'react-big-calendar';
import "react-calendar/dist/Calendar.css";
import { Link } from "react-router-dom";

const EventSidebar = ({ activeEvent }) => {
  const [value, onChange] = useState(new Date());

  return (
    <PerfectScrollbar
      className={`event-sidebar dz-scroll ${activeEvent ? "active" : ""}`}
      id="eventSidebar"
    >
      <Calendar
        localizer={localizer}
        events={events}
        startAccessor="start"
        endAccessor="end"
        messages={messages}
        eventPropGetter={eventStyleGetter}
        onDoubleClickEvent={onDoubleClick}
        onSelectEvent={onSelectEvent}
        onView={onViewChange}
        onSelectSlot={onSelectSlot}
        selectable={true}
        view={lastView}
        components={{
          event: CalendarEvent,
        }}
      />

      {/* <div className="card rounded-0 mb-0 h-auto bg-transparent shadow-none">
        <div className="card-body event-calender pb-2 text-center">
          <Calendar onClickDay={()=>{
            console.log('jkgn')
          }}  onChange={onChange} value={value} />
        </div>
      </div> */}
    </PerfectScrollbar>
  );
};

export default EventSidebar;
